import styled from 'styled-components';

const ItemStyles = styled.div`
  background: white;
  padding: 1rem;
  min-height: 220px;
  text-align: center;
  .item-image {
    display: inline-block;
    margin: 1.3rem;
  }
`;

export { ItemStyles };
